import React from 'react';
import './App.css';

function App() {
  return (
    <div className="container">
      <h1>Page Title</h1>
      <p>lorem</p>
      <ul>
        <li>One</li>
        <li>Two</li>
        <li>Three</li>
        <li>Four</li>
      </ul>
    </div>
  );
}

export default App;
